  return (
    <div className="App">
     <Routes>
      <Route path="/login" element={Login}/>
      <Route path="/appointment" element={schedule_appoint}/>
      <Route path="/register" element={Reg}/>
     </Routes>
    </div>
  );
}

export default App;
